import React from "react";
import InnerNav from "../NavBar/InnerNav";

function CallLogs() {
  return (
    <div className="grid">
      <InnerNav />

      <div id="CallLogs">
        <h1>Heres your call logs!</h1>
      </div>
    </div>
  );
}

export default CallLogs;
